      function encrypt(text, key) {
        //
        var result = "";
        text = Base64.encode(text);
        for (var i = 0; i < text.length; i++) {
          result += String.fromCharCode(key.charCodeAt(i % key.length) ^ text.charCodeAt(i));
        }
        return encodeURIComponent(result);
      }

